How can I read data from *mongo.UpdateResult type in Golang (UpdateOne, $addToSet)<p>I am utilizing the Go MongoDB driver to find and update one record in MongoDB, which works as expected.  I am struggling with the return value from <code>collection.UpdateOne</code> (of type <code>*mongo.UpdateResult</code>).  Here is the function</p>
<pre class="lang-golang prettyprint-override"><code>func AddPaidByYYYYmm(id string, YYYYmm string) (int, error) {
    ctx := context.Background()
    _id, err := primitive.ObjectIDFromHex(id)
    if err != nil {
        log.Fatal(err)
    }
    if !CheckYearMonthFormat(YYYYmm) {
        return 0, errors.New(&quot;ill-formed date format; must be YYYY-mm&quot;)
    }
    result, err := collection.UpdateOne(ctx, bson.M{&quot;_id&quot;: _id}, bson.M{&quot;$addToSet&quot;: bson.M{&quot;paid&quot;: YYYYmm}})
    fmt.Println(result)
    if err != nil {
        log.Fatal(err)
    }
    if result.MatchedCount == 0 {
        return 0, errors.New(&quot;no document matched id&quot;)
    }
    return 1, nil
}
</code></pre>
<p>Here are the three scenarios I am seeing and their respective return values (all of which are of type <code>*mongo.UpdateResult</code>):</p>
<ol>
<li>Record not found, string not added to MongoDB: <code>&amp;{0 0 0 &lt;nil&gt;}</code></li>
<li>Record found, string added to the array in the db: <code>&amp;{1 1 0 &lt;nil&gt;}</code></li>
<li>Record found, string is already in db and not added: <code>&amp;{1 0 0 &lt;nil&gt;}</code></li>
</ol>
<p>The issue is, I do not know how to read this data. Any guidance on how to get to this would be helpful. Please let me know if I have been unclear on anything or if anyone has any questions.</p>

