<pre><code>  {
    $match: {
      &quot;cards.[].listings.0&quot;: {
        $exists: true,
      },
    },
  },
</code></pre>
<p>I'm looking for parent documents which have <code>cards</code> which also have <code>listings</code>.</p>
<p>I've seen something like the above syntax before, although I'm not sure what this syntax is called or if it's possible to use it for double-nested arrays.</p>; Answer: They decay more often than just as function arguments. `[]` and unary `*` are in fact defined **only** for pointer operands. The array decays before the arithmetic is preformed.

